Clinic_1.query:
q = load "${App.Datasets.HLS_Care_Request8_tp.FullyQualifiedName}";
q = filter q by 'Case.Status' != "Closed";
q = filter q by 'CareRequestRecordType.Name' == "Admission";
q_D = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [{{cell(static_1.selection, 0, "Text2").asString()}}];
q_E = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [{{cell(static_1.selection, 0, "Text2").asString()}}];
q_F = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [{{cell(static_1.selection, 0, "Text2").asString()}}];
q_G = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [{{cell(static_1.selection, 0, "Text3").asString()}}];
q_H = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [{{cell(static_1.selection, 0, "Text3").asString()}}];
q_I = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [{{cell(static_1.selection, 0, "Text3").asString()}}];
result = group q by all full, q_D by all full, q_E by all full, q_F by all full, q_G by all full, q_H by all full, q_I by all;
result = foreach result generate coalesce(unique(q.'Id'),0) as 'A', coalesce(unique(q.'ClinicalCaseType'),0) as 'B', coalesce(avg(q.'Days_Since_Created'),0) as 'C', 
coalesce(unique(q_D.'Id'),0) as 'D', coalesce(unique(q_E.'ClinicalCaseType'),0) as 'E', coalesce(avg(q_F.'Days_Since_Created'),0) as 'F', unique(q_G.'Id') as 'G',
coalesce(unique(q_H.'ClinicalCaseType'),0) as 'H', avg(q_I.'Days_Since_Created') as 'I';
result = foreach result generate 'A', 'B', 'C', 'D', 'E', 'F', 'G' , 'H', 'I', (D-G)/G as 'Percentage_Change_In_CareRequest', coalesce((E-H)/H,0) as 'K', coalesce((F-I)/I,0) as 'L',(F-I) as 'Change_In_Days';
result = foreach result generate 'D' as 'Admission Care Requests','E' as 'Admission Clinical Types',round('F',0) as 'Avg Age','G' as 'Admission Care Request Previous',round('I',0) as 'Avg Age Previous','Percentage_Change_In_CareRequest',round('Change_In_Days',0) as 'Change_In_Days';

